  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div id="committee">
        <Person />
        <Person />
        <Person />

        <Person />
        <Person />
        <Person />

        <Person />
        <Person />
        <Person />
      </div>
    );
  }
}

export default Committee;
